import React from "react";

const Nav_menu: React.FC = () => {

  const [isOpen, setIsOpen] = useState<boolean>(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };
  return (
    <div className="navbar_menu">
      <ul className="toogle_nav">
        <li className="active">ACCUEIL</li>
        <li>MENU</li>
        <li>LIVRAISONS</li>
        <li>COMMANDES</li>
      </ul>
    </div>
  );
};

export default Nav_menu;
